Når du skal søge et objekt i et indeks eller en liste, kan du bruge Duck Typing for at finde det. Når du prøver et objekt i en liste, kan du teste om det matcher med alle indata i listen. Hvis det gør, så vil du finde objektet.

Her er et eksempel på hvordan du kunne bruge Duck Typing for at søge objekter i en liste:
```typescript
function findDuck(list: Array<object>): object {
  for (let i = 0; i < list.length; i++) {
    let candidate: object = list[i];
    if (candidate instanceof Object) {
      if (typeof candidate === "object") {
        if (candidate.constructor === Object) {
          return candidate;
        } else {
          // Duck Typing tester om et objekt er en objekt-klasse og ikke bare et "vanlig" objekt. 
          return findDuck(candidate);
        }
      } else {
        // Hvis et objekt ikke er en Object-klasse, så vil vi ikke søge etter det i listen. 
        continue;
      }
    } else {
      // Hvis ikke alle objektene i listen er av type Object, så vil vi ikke søke etter dem. 
      continue;
    }
  }
}

